import React from 'react';
import Logo from '../Images/MIS SERVICES REQUEST (1).png';
import Logo2 from '../Images/MIS SERVICES REQUEST (1).png';

const Header = () => {
	return (
		<div className='header'>
			<div className='logo'>
				<h1 className='logocolor'><img src={Logo} alt='logo' /><img src={Logo} alt='logo' /></h1>
			</div>

		</div>
	);
};
export default Header;
